import React, { useState, useEffect }  from "react";
import parse from 'html-react-parser';
import { Card,Image } from "react-bootstrap";
import { useParams } from "react-router-dom";

const RenderText = ({str}) =>{
    return(
        parse(str)
    )
}


const WikiRedact  = () => {
    
    const par = useParams();
    console.log(par);

    const text = '<div>\
	<img  src="https://kalix.club/uploads/posts/2023-03/1677710138_kalix-club-p-zastavka-na-glavnii-ekran-telefona-oboi-52.jpg" alt="Картинка" width="600">\
    </div>'

    return (
        <Card
            style={{borderRadius: 20, margin: '0px 50px 0px 50px', borderWidth: '5px'}}
        >
            <div style={{margin: 20}}>
                <RenderText str={text}/>
            </div>
        </Card>
    );
};

export default WikiRedact;
